"security_json" : ""{
  "Title":"Segurança",
  "Content":"O aplicativo do Fillr armazena suas informações apenas em seu celular, e seus dados nunca poderão ser acessados por qualquer pessoa além de você. Queremos que VOCÊ tenha controle sobre os seus dados. O app é protegido por PIN e armazenado apenas em seu dispositivo móvel, fora da nuvem, usando criptografia AES 256-bit de nível militar.",
  "Url":"https://www.google.com/android/devicemanager"
}""

"about_json" : ""{
  "Title":"Fillr",
  "Content":"我们打造 Fillr 的目标就是让用户可以在移动平台上毫不费力地填充表单。Fillr 的内建技术专为应对日趋复杂的网上生活而设计，可以快速且准确地填充表单。访问这个地址来了解更多：",
  "Url":"http://fillr.com/about"
}""

"security_json" : "{
  "Title":"Seguridad",
  "Content":"La aplicación Fillr almacena tu información solamente en tu teléfono y tus datos nunca pueden ser consultados por nadie más que tú. Queremos que seas TÚ quien tenga el control de tus datos. Están protegidos con código PIN y almacenados exclusivamente en tu dispositivo móvil, fuera de la nube, utilizando una codificación AES de 256 bits de categoría militar. 

Si pierdes tu teléfono, accede a la siguiente URL y sigue las indicaciones proporcionadas.",
  "Url":"https://www.google.com/android/devicemanager"
}"

"about_json" : "{
  "Title":"Fillr",
  "Content":"Fillr の使命は、モバイルデバイスでのフォーム入力を限りなく簡単にすることです。Fillr は、複雑化するユーザーのオンライン行動に合わせて開発されたテクノロジーにより、フォームをすばやく正確に自動入力します。詳しくはこちら:",
  "Url":"http://fillr.com/about"
}"

"security_json" : "{
  "Title":"Sicurezza",
  "Content":"L'app Fillr archivia le informazioni solo sul tuo telefono e i tuoi dati non saranno mai accessibili ad altri, eccetto te. Vogliamo che sia TU ad avere il controllo dei tuoi dati. Essi sono protetti da PIN ed archiviati sul tuo dispositivo mobile, fuori dal cloud, utilizzando la crittografia AES 256 bit di grado militare.

Se dovessi perdere il tuo telefono, visita l'indirizzo qui sotto e segui le istruzioni.",
  "Url":"https://www.google.com/android/devicemanager"
}"

"security_json" : ""{
  "Title":"安全性",
  "Content":"Fillr app 只会将你的信息存储在你的手机上。你的数据永远不会被除你之外的其他人访问。我们想确保你的数据你做主。它有 PIN 保护，存储在本地而非云端，并使用军用级别 256 位 AES 加密技术。",
  "Url":"https://www.google.com/android/devicemanager"
}""

"security_json" : "{
  "Title":"보안",
  "Content":"Fillr 앱은 사용자의 정보를 사용자의 기기에만 저장하므로 다른 사람은 절대로 사용자의 데이터를 액세스할 수 없습니다. 저희는 사용자가 자신의 데이터를 관리할 것을 바랍니다. 정보는 PIN으로 보호되며 256-비트 AES 암호화 기술을 이용해 클라우드가 아닌 사용자의 모바일 기기에만 저장됩니다.

기기를 잃어버리신 경우 아래에 있는 url을 방문해서 안내에 따라주십시오.",
  "Url":"https://www.google.com/android/devicemanager"
}"

"about_json" : ""{
  "Title":"Fillr",
  "Content":"Nossa missão no Fillr é tornar fácil o preenchimento de formulários em dispositivos móveis. O Fillr preenche formulários rapidamente e com precisão, usando a tecnologia desenvolvida para a crescente complexidade da sua vida online. Para saber mais, acesse:",
  "Url":"http://fillr.com/about"
}""

"security_json" : "{
  "Title":"Sécurité",
  "Content":"L'appli Fillr stocke vos informations uniquement sur votre téléphone et vos données ne sont jamais accessibles à personne d'autre que vous. Nous voulons que VOUS contrôliez vos données. Les données sont protégées par code PIN et conservées uniquement sur votre appareil mobile, en dehors du cloud, en utilisant le cryptage de niveau militaire 256-bit AES.

S'il vous arrive de perdre votre téléphone, rendez-vous à l'url ci-dessous et suivez les instructions.",
  "Url":"https://www.google.com/android/devicemanager"
}"

"about_json" : "{
  "Title":"Fillr",
  "Content":"Notre mission chez Fillr est de rendre le remplissage de formulaires sur mobile facile et sans effort. Fillr remplit les formulaires rapidement et avec précision en utilisant une technologie reposant sur la complexité croissante de votre vie en ligne. Pour en savoir plus, dirigez-vous vers :",
  "Url":"http://fillr.com/about"
}"

"about_json" : "{
  "Title":"Fillr",
  "Content":"La nostra missione su Fillr è quella di rendere il riempimento di moduli su dispositivi mobili senza sforzi. Fillr compila i moduli rapidamente ed accuratamente utilizzando una tecnologia studiata sulla base della crescente complessità della vita online. Per scoprirne di più visita:",
  "Url":"http://fillr.com/about"
}"

"security_json" : "{
  "Title":"セキュリティ",
  "Content":"Fillr アプリは、ユーザーの個人情報を端末上にのみ保存します。外部の第三者によってアクセスすることは完全に不可能です。弊社は、いかなるセキュリティ保護対策を講じようとも、個人情報は本人の手元以外で保管・管理されるべきでないと考えます。すべての個人情報は PIN (セキュリティコード) によって保護され、ミリタリーグレードの 256-bit AES で暗号化した上でユーザー本人のモバイルデバイス上にのみ保存されます。 クラウドサーバなど外部に送信されることは絶対にありません。

デバイスを紛失したときは、以下の URL にアクセスして画面の指示に従ってください。",
  "Url":"https://www.google.com/android/devicemanager"
}"

"about_json" : "{
  "Title":"Fillr",
  "Content":"Nuestra misión en Fillr es eliminar todo esfuerzo para rellenar formularios en dispositivos móviles. Fillr rellena formularios rápidamente y con precisión utilizando una tecnología construida a partir de la creciente complejidad de tu vida en línea. Para obtener más información, accede a:",
  "Url":"http://fillr.com/about"
}"
